import React, { useState, useEffect } from 'react';
import { Users as UsersIcon, Search, Calendar, Mail } from 'lucide-react';
import axios from 'axios';
import toast from 'react-hot-toast';

const Users = () => {
  const [users, setUsers] = useState([]);
  const [isLoading, setIsLoading] = useState(true);
  const [searchTerm, setSearchTerm] = useState('');

  useEffect(() => {
    fetchUsers();
  }, []);

  const fetchUsers = async () => {
    try {
      const response = await axios.get('/api/users');
      if (response.data.success) {
        setUsers(response.data.users);
      }
    } catch (error) {
      console.error('Error fetching users:', error);
      toast.error('Failed to load users');
    } finally {
      setIsLoading(false);
    }
  };

  const filteredUsers = users.filter(user => 
    user.firstName.toLowerCase().includes(searchTerm.toLowerCase()) ||
    user.lastName.toLowerCase().includes(searchTerm.toLowerCase()) ||
    user.email.toLowerCase().includes(searchTerm.toLowerCase())
  );

  const formatDate = (dateString) => {
    return new Date(dateString).toLocaleDateString('en-US', {
      year: 'numeric',
      month: 'short',
      day: 'numeric',
      hour: '2-digit',
      minute: '2-digit'
    });
  };

  if (isLoading) {
    return (
      <div className="loading">
        Loading users...
      </div>
    );
  }

  return (
    <div>
      <h1 className="page-title">User Management</h1>
      <p className="page-subtitle">
        View and manage all registered users on the platform
      </p>

      <div className="card">
        <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', marginBottom: '2rem' }}>
          <div>
            <h2 style={{ marginBottom: '0.5rem', color: '#333' }}>
              <UsersIcon size={24} style={{ marginRight: '8px', verticalAlign: 'middle' }} />
              All Users ({users.length})
            </h2>
            <p style={{ color: '#666', margin: 0 }}>
              Manage user accounts and view registration details
            </p>
          </div>
          
          <div style={{ position: 'relative' }}>
            <Search size={20} style={{ 
              position: 'absolute', 
              left: '12px', 
              top: '50%', 
              transform: 'translateY(-50%)',
              color: '#666'
            }} />
            <input
              type="text"
              placeholder="Search users..."
              value={searchTerm}
              onChange={(e) => setSearchTerm(e.target.value)}
              style={{
                padding: '12px 16px 12px 40px',
                border: '2px solid #e1e5e9',
                borderRadius: '8px',
                fontSize: '16px',
                width: '300px',
                outline: 'none'
              }}
            />
          </div>
        </div>

        {filteredUsers.length === 0 ? (
          <div className="empty-state">
            <h3>No Users Found</h3>
            <p>
              {searchTerm 
                ? `No users match "${searchTerm}". Try a different search term.`
                : 'No users have registered yet. Users will appear here once they sign up.'
              }
            </p>
          </div>
        ) : (
          <div style={{ overflowX: 'auto' }}>
            <table className="users-table">
              <thead>
                <tr>
                  <th>Name</th>
                  <th>Email</th>
                  <th>Registration Date</th>
                  <th>Last Login</th>
                  <th>Status</th>
                </tr>
              </thead>
              <tbody>
                {filteredUsers.map((user) => (
                  <tr key={user._id}>
                    <td>
                      <div style={{ display: 'flex', alignItems: 'center', gap: '8px' }}>
                        <div style={{
                          width: '32px',
                          height: '32px',
                          borderRadius: '50%',
                          background: 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)',
                          display: 'flex',
                          alignItems: 'center',
                          justifyContent: 'center',
                          color: 'white',
                          fontSize: '14px',
                          fontWeight: 'bold'
                        }}>
                          {user.firstName.charAt(0)}{user.lastName.charAt(0)}
                        </div>
                        <div>
                          <div style={{ fontWeight: '600', color: '#333' }}>
                            {user.firstName} {user.lastName}
                          </div>
                        </div>
                      </div>
                    </td>
                    <td>
                      <div style={{ display: 'flex', alignItems: 'center', gap: '4px' }}>
                        <Mail size={16} style={{ color: '#666' }} />
                        {user.email}
                      </div>
                    </td>
                    <td>
                      <div style={{ display: 'flex', alignItems: 'center', gap: '4px' }}>
                        <Calendar size={16} style={{ color: '#666' }} />
                        {formatDate(user.registrationDate)}
                      </div>
                    </td>
                    <td>
                      {user.lastLogin ? formatDate(user.lastLogin) : 'Never'}
                    </td>
                    <td>
                      <span style={{
                        padding: '4px 8px',
                        borderRadius: '12px',
                        fontSize: '12px',
                        fontWeight: '500',
                        background: user.isActive ? '#d4edda' : '#f8d7da',
                        color: user.isActive ? '#155724' : '#721c24'
                      }}>
                        {user.isActive ? 'Active' : 'Inactive'}
                      </span>
                    </td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        )}
      </div>

      {users.length > 0 && (
        <div className="card">
          <h2 style={{ marginBottom: '2rem', color: '#333' }}>
            <Calendar size={24} style={{ marginRight: '8px', verticalAlign: 'middle' }} />
            Registration Summary
          </h2>
          
          <div className="analytics-grid">
            <div className="analytics-card">
              <div className="analytics-number">{users.length}</div>
              <div className="analytics-label">Total Users</div>
            </div>
            
            <div className="analytics-card">
              <div className="analytics-number">
                {users.filter(user => user.isActive).length}
              </div>
              <div className="analytics-label">Active Users</div>
            </div>
            
            <div className="analytics-card">
              <div className="analytics-number">
                {users.filter(user => {
                  const thirtyDaysAgo = new Date();
                  thirtyDaysAgo.setDate(thirtyDaysAgo.getDate() - 30);
                  return new Date(user.registrationDate) >= thirtyDaysAgo;
                }).length}
              </div>
              <div className="analytics-label">Recent Registrations</div>
            </div>
            
            <div className="analytics-card">
              <div className="analytics-number">
                {users.filter(user => {
                  const today = new Date();
                  const userDate = new Date(user.registrationDate);
                  return userDate.toDateString() === today.toDateString();
                }).length}
              </div>
              <div className="analytics-label">Today's Registrations</div>
            </div>
          </div>
        </div>
      )}
    </div>
  );
};

export default Users;
